import React from "react";

function Projects() {
  return (
    <div>
      <h1 id="projects">My Babies</h1>
      <div className="row">
        <div className="column2">
          <h4>PeriodicTables</h4>
          <img
            // className="imageClass"
            src={require("./periodicTables.png")}
            // style={{ marginRight: "50px", marginBottom: "25px" }}
          />
          <p>A restaurant reservation system </p>
          <p>React, CSS, Express, Knex, PostgreSQL.</p>
        </div>
        <div className="column2">
          <h4>WeLoveMovies</h4>
          <img
            // className="imageClass"
            src={require("./WeLoveMovies.png")}
            // style={{ marginBottom: "25px" }}
          />
          <p>Find Your Favorite Movie</p>
          <p>Node, Express, Knex, PostgreSQL, HTTP </p>
        </div>
      </div>
    </div>
  );
}

export default Projects;
